import { useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { RootState } from '../../redux/store';

import { ILog, setLogs } from '../../redux/logsSlice';
import quotesJson from '../../assets/json/quotes.json';
import Panel from '../../components/Panel/Panel';
import styled from 'styled-components';
import axios from 'axios';

export default function Dashboard() {
	const dispatch = useDispatch();
	const randomQuoteNum = Math.floor(Math.random() * quotesJson.length);

	const initialize = async () => {
		(state: RootState) => state.journallogs;
		const { userID } = useSelector((state: RootState) => state.auth);

		try {
			const response = await axios.post('http//:localhost:5001/api/logs', userID, {
				headers: {
					'Content-Type': 'application/json',
					'Access-Control-Allow-Origin': '*',
				},
			});

			const data = await response.data;
			if (data) {
				dispatch(
					setLogs({
						logs: data.logs,
					})
				);
			}
		} catch (err) {
			console.log(err);
		}
	};

	useEffect(() => {
		initialize();
	}, []);

	const DashboardContainer = styled.div`
		display: flex;
		width: 100%;
		height: 90vh;
		justify-content: center;
		align-items: center;

		.panels-container {
			width: 100%;
			height: 80%;
		}

		.panel {
			width: 100%;
			padding: 2rem;
			margin: 1rem;
			text-align: left;
			border-radius: 1rem;
			background-color: #f2f3fc
box-shadow: -1px -1px 30px 0px rgba(145,145,145,0.04);
-webkit-box-shadow: -1px -1px 30px 0px rgba(145,145,145,0.04);
-moz-box-shadow: -1px -1px 30px 0px rgba(145,145,145,0.04);
		}

		.panel-flex {
			display: flex;
		}

		.panels-upper {
			height: 50%;

			.panel-quote {
				width: 66.3%;
			}
			.panel-points {
				width: 33.3%;
			}
		}


		.quote {
			width: 100%;
			height: 100%;
			padding: 2rem 0;

			.quote-title{
				height: 75%;

				h1{
         font-size: 2.5rem;
				}
			}

		.quote-author {
				width: 100%;
				text-align: right;
			}
		}

		.points-value {
			width: 100%;
			height: 90%;
			display:flex;
			align-items: center;
			justify-content: center;

			h1{
				font-weight: 100
			}
		}

		.points-title{
			text-align: center;
			height: 10%;
		}

		// LOWER PANEL

		.panel-lower {
			height: 50%;

			.panel-link {
				width: 33%;
			}
		}

		.panel-link-header {
			height: 10%;
		}
		.panel-link-button {
			height: 90%;
			display: flex;
			align-items: end
			justify-content: end;
			width: 100%

			button{
				border: none;
				background-color:#6d63d5;
        background: rgb(108,99,205);
        background: linear-gradient(0deg, rgba(108,99,205,1) 0%, rgba(121,107,190,1) 100%);
				padding: 0.5rem 1rem;
				border-radius: 3rem;
				h2{
					color: white !important;
				}
			}

		}

	`;
	return (
		<DashboardContainer>
			<div className='panels-container'>
				<div className='panels-upper panel-flex'>
					<div className='panel-quote panel-flex'>
						<div className='panel'>
							<div className='quote'>
								<div className='quote-title'>
									<h1>{quotesJson[randomQuoteNum].quote}</h1>
								</div>
								<div className='quote-author'>
									<p>-{quotesJson[randomQuoteNum].author}</p>
								</div>
							</div>
						</div>
					</div>
					<div className='panel-points panel-flex'>
						<div className='panel'>
							<div className='points-title'>
								<h2>Points</h2>
							</div>
							<div className='points-value'>
								<h1>143</h1>
							</div>
						</div>
					</div>
				</div>
				<div className='panel-lower panel-flex'>
					<Panel redirect='/user/1/journal' titleText='Your Journal' />
					<Panel redirect='/user/1/journal' titleText='Analysis your thoughts' />
					<Panel redirect='/user/1/journal' titleText='Questions to make you think' />
				</div>
			</div>
		</DashboardContainer>
	);
}
